import React from 'react';

const Dashboard: React.FC = () => {
    return ( 
        <div>
        <header className="header">
          <h1>todos</h1>
          <input
            ref="newField"
            className="new-todo"
            placeholder="What needs to be done?"
            onKeyDown={ e => this.handleNewTodoKeyDown(e) }
            autoFocus={true}
          />
        </header>
        </div>
    )
}

export default Dashboard;
